const dedup = <T>(xs: T[]): T[] => Array.from(new Set(xs).values());

const removeElementAtIndex = <T>(xs: T[], i: number): T[] =>
  xs.slice(0, i).concat(xs.slice(i + 1));

const removeFirst = <T>(xs: T[], x: T): T[] => {
  const i = xs.indexOf(x);
  return i >= 0 ? removeElementAtIndex(xs, i) : xs;
};

const mkArray = (from: number, to: number): number[] =>
  to >= from ? [...new Array(to - from + 1)].map((_, i) => i + from) : [];

const isSubstring = (s: string, words: string[]): boolean =>
  words.length === 0 ||
  dedup(words).reduce(
    (res: boolean, w: string): boolean =>
      res ||
      (s.startsWith(w)
        ? isSubstring(s.slice(w.length), removeFirst(words, w))
        : false),
    false,
  );

function findSubstring(s: string, words: string[]): number[] {
  const l = words.map((w) => w.length).reduce((wl, x) => wl + x, 0);
  return mkArray(0, s.length - l).reduce(
    (ixs, i) => (isSubstring(s.slice(i), words) ? ixs.concat([i]) : ixs),
    [],
  );
}

